import React from 'react';
//import './App.css';
import Container from 'react-bootstrap/Container'
import Table from 'react-bootstrap/Table'

import axios from 'axios';

let one = "http://api.waqi.info/feed/stockholm/?token=6460bc98321176676eee4a2d07153eb8854628fe"
let two = "http://api.waqi.info/feed/göteborg/?token=6460bc98321176676eee4a2d07153eb8854628fe"

const requestOne = axios.get(one);
const requestTwo = axios.get(two);

var obj;
var response;

var city;
var name;

var forecast;
var daily;
var pm25;
var today

var avg;
var day;
var max;
var min;

// Cities
var stockholm;
var goteborg;
var cityList = [stockholm, goteborg];

var elements = {};
var element1;

export default class Experiment3 extends React.Component {
  state = {
    persons: []
  }

  componentDidMount() {
    axios.all([requestOne, requestTwo])
      .then(res => {
        stockholm = res[0].data;
        goteborg = res[1].data;

        function myFunction(x, y) {
            response = x[Object.keys(x)[1]];

            city = response[Object.keys(response)[3]];
            name = city[Object.keys(city)[1]];

            forecast = response[Object.keys(response)[7]];
            daily = forecast[Object.keys(forecast)[0]];
            pm25 = daily[Object.keys(daily)[2]];
            today = pm25[Object.keys(pm25)[2]];

            avg = today[Object.keys(today)[0]];
            day = today[Object.keys(today)[1]];
            max = today[Object.keys(today)[2]];
            min = today[Object.keys(today)[3]];

            return cityList[y] = {name: name, avg: avg, day: day, max: max, min: min};
          }


        myFunction(stockholm, 0);
        element1 = cityList[0]

        //myFunction(goteborg, 1);
        //element2 = cityList[1]

        elements['stockholm'] = element1


        const persons = elements;
        this.setState({ persons });
      })
  }

  render() {
    return (
      <Container>
<Table striped bordered hover size="sm">
<thead>
  <tr>
    <th>Stad</th>
    <th>Genomsnitt</th>
    <th>Datum</th>
    <th>Dagens Max</th>
    <th>Dagens Min</th>
  </tr>
  </thead>
  <tbody>
  <tr>
    <td>{ this.state.persons.stockholm.name}</td>
    <td>{ this.state.persons.stockholm.avg}</td>
    <td>{ this.state.persons.stockholm.day}</td>
    <td>{ this.state.persons.stockholm.max}</td>
    <td>{ this.state.persons.stockholm.min}</td>
  </tr>
  </tbody>
</Table>
</Container>
    )
  }
}
